tWines MntFruits MntMeatProducts MntFishProducts MntSweetProducts\n1    85       1         16              2               1             \n2    55      16       1622             17               3             \n3    39       1          9              2               0             \n4    20       2       1582              1               2             \n5     1       0       1725              2               1             \n6     2       1          2              1               1             \n7     1       1          1              1               1             \n8     6       2          3              1             262             \n9  1009     181        104            202              21             \n10  168     148        444             32             172             \n   MntGoldProds\n1    2         \n2    4         \n3    8         \n4    1         \n5    1         \n6    1         \n7    1         \n8    3         \n9  207         \n10 148         "},"metadata":{}}]},{"cell_type":"markdown","source":"## 2.3 Attribute and regression matrices\nFirst, create matrices of attributes.","metadata":{}},{"cell_type":"code","source":"people_attrs <- customers[, c(\"Age\", \"Graduated\", \"Married\", \"Income\", \"HaveKids\",\n                              \"DaysCustomer\", \"Recency\", \"Complain\")]\nproduct_attrs <- customers[, c(\"MntWines\", \"MntFruits\", \"MntMeatProducts\", \n                               \"MntFishProducts\", \"MntSweetProducts\", \"MntGoldProds\")]\npromotion_attrs <- customers[, c(\"NumDealsPurchases\", \"AcceptedCmp1\", \"AcceptedCmp2\", \n                                 \"AcceptedCmp3\", \"AcceptedCmp4\", \"AcceptedCmp5\", \"Response\")]\nplace_attrs <- customers[, c(\"NumWebPurchases\", \"NumCatalogPurchases\", \"NumStorePurchases\")]","metadata":{"execution":{"iopub.status.busy":"2022-12-01T09:56:59.250698Z","iopub.execute_input":"2022-12-01T09:56:59.253256Z","iopub.status.idle":"2022-12-01T09:56:59.283893Z"},"trusted":true},"execution_count":15,"outputs":[]},{"cell_type":"code","source":"attach(customers)","metadata":{"execution":{"iopub.status.busy":"2022-12-01T09:57:49.703914Z","iopub.execute_input":"2022-12-01T09:57:49.705621Z","iopub.status.idle":"2022-12-01T09:57:49.728106Z"},"trusted":true},"execution_count":17,"outputs":[]},{"cell_type":"markdown","source":"Next, create dataframes for regression analysis. This project will be exploring 3 products with the following response variables:\n\n* Wine\n* Food (fish, meat and fruits combined)\n* Sweet products\n\nAlthough spending on gold products are included in the original dataset, this product type will not be explored as common supermarkets will probably not sell gold products.\n\nOur predictors will be all of the customer attributes. Hence, here 3 dataframes are created that contains one of the response variables (wine, food, or sweets) and all of the predictors.","metadata":{}},{"cell_type":"code","source":"# wine dataframe\ndf.wine <- cbind(MntWines, people_attrs)\n\n# Food dataframe\nMntFood <- MntFishProducts + MntMeatProducts + MntFruits\ndf.food <- cbind(MntFood, people_attrs)\n\n# Sweets dataframe\ndf.sweet <- cbind(MntSweetProducts, people_attrs)","metadata":{"execution":{"iopub.status.busy":"2022-12-01T09:57:53.344568Z","iopub.execute_input":"2022-12-01T09:57:53.34623Z","iopub.status.idle":"2022-12-01T09:57:53.368774Z"},"trusted":true},"execution_count":18,"outputs":[]},{"cell_type":"markdown","source":"## 2.4 Splitting into training and test set","metadata":{}},{"cell_type":"code","source":"# splitting dataframes into training set and test set\nset.seed(1)\n\n# wine\nwine.split <- initial_split(df.wine, prop=0.7, strata = MntWines)\nwine.train <- training(wine.split)\nwine.test <- testing(wine.split)\n\n# food\nfood.split <- initial_split(df.food, prop=0.7, strata = MntFood)\nfood.train <- training(food.split)\nfood.test <- testing(food.split)\n\n# sweets\nsweet.split <- initial_split(df.sweet, prop=0.7, strata = MntSweetProducts)\nsweet.train <- training(sweet.split)\nsweet.test <- testing(sweet.split)","metadata":{"execution":{"iopub.status.busy":"2022-12-01T09:58:22.114939Z","iopub.execute_input":"2022-12-01T09:58:22.117799Z","iopub.status.idle":"2022-12-01T09:58:22.30989Z"},"trusted":true},"execution_count":19,"outputs":[]},{"cell_type":"markdown","source":"## 2.5 Target & Feature engineering\n\nTarget & feature engineering include the following steps:\n\n* Log-transformed the outcome variables, which are spending on each product category (`MntWines` for wine, `MntFood` for food, and `MntSweetProducts` for sweets). Set `offset=1` since some spendings are 0 and will return `-Inf` if take log for that. \n* Dummy encoded all categorical vairables (such as `Graduated`, `Married`, `HaveKids`, etc.)\n* Centered and scaled all numerical vairables (except for outcome variables)\n\n**Target & Feature engineering for wine dataframe**\n","metadata":{}},{"cell_type":"code","source":"hist(MntWines)","metadata":{"execution":{"iopub.status.busy":"2022-12-01T09:59:03.034734Z","iopub.execute_input":"2022-12-01T09:59:03.036288Z","iopub.status.idle":"2022-12-01T09:59:03.162605Z"},"trusted":true},"execution_count":20,"outputs":[{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd2CU9f3A8SeDDHZYshyICKgQN/zUqjhYAs5qHeAoVqs4a+vCVevAtsaBWmcR\nHFStVlAcVdGKorWOoCAUFbAqqOyVnfv9kRAQIVyE5LhvXq+/Ls89uftcksq7z93zfFNisVgE\nAEDyS030AAAAbBnCDgAgEMIOACAQwg4AIBDCDgAgEMIOACAQwg4AIBDCDgAgEMIOACAQwg4A\nIBDCDgAgEMIOACAQwg4AIBDCDgAgEMIOACAQwg4AIBDCDgAgEMIOACAQwg4AIBDCDgAgEMIO\nACAQwg4AIBDCDgAgEMIOACAQwg4AIBDCDgAgEMIOACAQwg4AIBDCDgAgEMIOACAQwg4AIBDC\nDgAgEMIOACAQwg4AIBDCDgAgEMIOACAQwg4AIBDCDgAgEMIOACAQwg62Ut/nD0lZ49hPF/14\nh1cGbF+1w4erSio2fvvuoKqNc4vK6nbkeq780WvP3HWHNpnp6RlZjXpd8t7G9vvfS31Tfmj0\nNyvX2+fZgzqst09RbMtMOfXXu1Q95vDpP/i7mv/WMVV37fvHj9e9q2Dhk1V3tdnzwchfGmyt\nhB2w1v575Pbo0aNHjx5Dn5yT6FmSzGePHHPKdQ/MmPd9cVlZSdHqFatK4//eJ19bsN6W+z9Z\nsk