ub.execute_input":"2022-12-01T09:59:32.308848Z","iopub.status.idle":"2022-12-01T09:59:33.843531Z"},"trusted":true},"execution_count":21,"outputs":[]},{"cell_type":"markdown","source":"Retrieve the mean and standard deviation for `income` after imputation but before centering and scaling, as this will enable reverting the normalized income values back to the original scales.","metadata":{}},{"cell_type":"code","source":"set.seed(1)\nwine.income.impute <- recipe(MntWines ~ ., data = wine.train) %>%\n  step_impute_bag(Income) %>% \n  prep(training = wine.train, retain = TRUE) %>% \n  juice()\nincome.mean.wine <- mean(wine.income.impute$Income)\nincome.sd.wine <- sd(wine.income.impute$Income)","metadata":{"execution":{"iopub.status.busy":"2022-12-01T09:59:51.867647Z","iopub.execute_input":"2022-12-01T09:59:51.870125Z","iopub.status.idle":"2022-12-01T09:59:52.733743Z"},"trusted":true},"execution_count":22,"outputs":[]},{"cell_type":"markdown","source":"**Target & Feature engineering for food dataframe**","metadata":{}},{"cell_type":"code","source":"set.seed(1)\nfood.blueprint <- recipe(MntFood ~ ., data = food.train) %>%\n  step_nzv(all_nominal())  %>%\n  step_impute_bag(Income) %>% \n  step_log(all_outcomes(), offset = 1) %>% \n  step_dummy(all_nominal()) %>%\n  step_center(all_numeric(), -all_outcomes()) %>%\n  step_scale(all_numeric(), -all_outcomes())\nprepare.food <- prep(food.blueprint, training = food.train)\nbaked.food.train <- recipes::bake(prepare.food, new_data = food.train)\nbaked.food.test <- recipes::bake(prepare.food, new_data = food.test)\n\n# retrieving the mean and sd for income\nfood.income.impute <- recipe(MntFood ~ ., data = food.train) %>%\n  step_impute_bag(Income) %>% \n  prep(training = food.train, retain = TRUE) %>% \n  juice()\nincome.mean.food <- mean(food.income.impute$Income)\nincome.sd.food <- sd(food.income.impute$Income)","metadata":{"execution":{"iopub.status.busy":"2022-12-01T10:00:13.020224Z","iopub.execute_input":"2022-12-01T10:00:13.026112Z","iopub.status.idle":"2022-12-01T10:00:14.921831Z"},"trusted":true},"execution_count":23,"outputs":[]},{"cell_type":"markdown","source":"**Target & Feature engineering for sweets dataframe**","metadata":{}},{"cell_type":"code","source":"sweet.blueprint <- recipe(MntSweetProducts ~ ., data = sweet.train) %>%\n  step_nzv(all_nominal())  %>%\n  step_impute_bag(Income) %>% \n  step_log(all_outcomes(), offset = 1) %>% \n  step_dummy(all_nominal()) %>%\n  step_center(all_numeric(), -all_outcomes()) %>%\n  step_scale(all_numeric(), -all_outcomes())\nprepare.sweet <- prep(sweet.blueprint, training = sweet.train)\nbaked.sweet.train <- recipes::bake(prepare.sweet, new_data = sweet.train)\nbaked.sweet.test <- recipes::bake(prepare.sweet, new_data = sweet.test)\n\n# retrieving the mean and sd for income\nsweet.income.impute <- recipe(MntSweetProducts ~ ., data = sweet.train) %>%\n  step_impute_bag(Income) %>% \n  prep(training = sweet.train, retain = TRUE) %>% \n  juice()\nincome.mean.sweet <- mean(sweet.income.impute$Income)\nincome.sd.sweet <- sd(sweet.income.impute$Income)","metadata":{"execution":{"iopub.status.busy":"2022-12-01T10:00:33.396755Z","iopub.execute_input":"2022-12-01T10:00:33.398391Z","iopub.status.idle":"2022-12-01T10:00:35.254512Z"},"trusted":true},"execution_count":24,"outputs":[]},{"cell_type":"markdown","source":"# 3. Method selection","metadata":{}},{"cell_type":"markdown","source":"Next, select a method to fit the final models. Workflow is as follows:\n\n* Implement a variety of methods (e.g. Xgboost/random forest/KNN) on only the wine dataframe, and record the training RMSE for each of the methods.\n* Based on the training RMSE, select the top models.\n* For each of these selected methods, fit the models on the test set, and select the one with the smallest test RMSE as the final model.\n* Fit the final model on the data to generate results, i.e. characteristics of customers that are likely to spend more on different product types.","metadata":{}},{"cell_type":"markdown","source":"## 3.1 Defining resampling method","metadata":{}},{"cell_type":"code","source":"cv <- trainControl(\n  method = \"repeatedcv\",\n  number = 10,\n  repeats = 5\n)","metadata":{"execution":{"iopub.status.busy":"2022-12-01T10:04:28.055476Z","iopub.execute_input":"2022-12-01T10:04:28.058361Z","iopub.status.idle":"2022-12-01T10:04:28.079964Z"},"trusted":true},"execution_count":25,"outputs":[]},{"cell_type":"markdown","source":"## 3.2 `Most Important` function\nCreate a function to store the most important features as a dataframe.","metadata":{}},{"cell_type":"code","source":"most_important <- function(vip) {\n  vip$data %>% \n  pull(Variable) %>% \n  as.data.frame()\n}","metadata":{"execution":{"iopub.status.busy":"2022-12-01T10:04:52.878922Z","iopub.execute_input":"2022-12-01T10:04:52.880851Z","iopub.status.idle":"2022-12-01T10:04:52.895369Z"},"trusted":true},"execution_count":26,"outputs":[]},{"cell_type":"markdown","source":"## 3.3 Linear regression","metadata":{}},{"cell_type":"code","source":"wine.lm = train(\n  MntWines ~ .,\n  data = baked.wine.train,\n  trControl = cv,\n  method = \"glm\",\n  metric = \"RMSE\"\n)\n# storing RMSE on the training set\n(rmse.lm <- getTrainPerf(wine.lm)[[1]])","metadata":{"execution":{"iopub.status.busy":"2022-12-01T10:05:16.841689Z","iopub.execute_input":"2022-12-01T10:05:16.843176Z","iopub.status.idle":"2022-12-01T10:05:18.530823Z"},"trusted":true},"execution_count":27,"outputs":[{"output_type":"display_data","data":{"text/html":"1.10158905004069","text/markdown":"1.10158905004069","text/latex":"1.10158905004069","text/plain":"[1] 1.101589"},"metadata":{}}]},{"cell_type":"code","source":"# storing the four most important features\nvip.lm <- most_important(vip(wine.lm))[1:4,]\n# variable importance plots\nvip(wine.lm)","metadata":{"execution":{"iopub.status.busy":"2022-12-01T10:06:04.398341Z","iopub.execute_input":"2022-12-01T10:06:04.40093Z","iopub.status.idle":"2022-12-01T10:06:04.848094Z"},"tr