arameters for Random Forest.","metadata":{}},{"cell_type":"code","source":"# create hyperparameter grid\nrf.hyper_grid <- expand.grid(\n  mtry = floor(n_features * c(.05, .15, .25, .333, .4)),\n  min.node.size = c(1, 3, 5, 10), \n  replace = c(TRUE, FALSE),                               \n  sample.fraction = c(.5, .63, .8),                       \n  rmse = NA                                               \n)\n\n# execute full cartesian grid search\nfor(i in seq_len(nrow(rf.hyper_grid))) {\n  # fit model for ith hyperparameter combination\n  fit <- ranger(\n    formula         = MntWines ~ ., \n    data            = baked.wine.train, \n    num.trees       = n_features * 10,\n    mtry            = rf.hyper_grid$mtry[i],\n    min.node.size   = rf.hyper_grid$min.node.size[i],\n    replace         = rf.hyper_grid$replace[i],\n    sample.fraction = rf.hyper_grid$sample.fraction[i],\n    verbose         = FALSE,\n    seed            = 123,\n    respect.unordered.factors = 'order',\n  )\n  # export OOB error \n  rf.hyper_grid$rmse[i] <- sqrt(fit$prediction.error)\n}\n\n# save the best rmse\nrmse.rf.best <- min(rf.hyper_grid$rmse)\n\n# assess top 5 models\nrf.hyper_grid %>%\n  arrange(rmse) %>%\n  mutate(perc_gain = (rmse.rf.default - rmse) / rmse.rf.default * 100) %>%\n  head(5)","metadata":{"execution":{"iopub.status.busy":"2022-12-01T10:09:00.984174Z","iopub.execute_input":"2022-12-01T10:09:00.985824Z","iopub.status.idle":"2022-12-01T10:09:06.328669Z"},"trusted":true},"execution_count":36,"outputs":[{"output_type":"display_data","data":{"text/html":"<table class=\"dataframe\">\n<caption>A data.frame: 5 × 6</caption>\n<thead>\n\t<tr><th></th><th scope=col>mtry</th><th scope=col>min.node.size</th><th scope=col>replace</th><th scope=col>sample.fraction</th><th scope=col>rmse</th><th scope=col>perc_gain</th></tr>\n\t<tr><th></th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;lgl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th></tr>\n</thead>\n<tbody>\n\t<tr><th scope=row>1</th><td>3</td><td> 1</td><td>FALSE</td><td>0.63</td><td>0.8658314</td><td>3.758258</td></tr>\n\t<tr><th scope=row>2</th><td>3</td><td> 5</td><td> TRUE</td><td>0.80</td><td>0.8659706</td><td>3.742780</td></tr>\n\t<tr><th scope=row>3</th><td>3</td><td> 5</td><td>FALSE</td><td>0.50</td><td>0.8668544</td><td>3.644548</td></tr>\n\t<tr><th scope=row>4</th><td>3</td><td>10</td><td> TRUE</td><td>0.80</td><td>0.8670348</td><td>3.624489</td></tr>\n\t<tr><th scope=row>5</th><td>3</td><td> 3</td><td>FALSE</td><td>0.63</td><td>0.8670504</td><td>3.622755</td></tr>\n</tbody>\n</table>\n","text/markdown":"\nA data.frame: 5 × 6\n\n| <!--/--> | mtry &lt;dbl&gt; | min.node.size &lt;dbl&gt; | replace &lt;lgl&gt; | sample.fraction &lt;dbl&gt; | rmse &lt;dbl&gt; | perc_gain &lt;dbl&gt; |\n|---|---|---|---|---|---|---|\n| 1 | 3 |  1 | FALSE | 0.63 | 0.8658314 | 3.758258 |\n| 2 | 3 |  5 |  TRUE | 0.80 | 0.8659706 | 3.742780 |\n| 3 | 3 |  5 | FALSE | 0.50 | 0.8668544 | 3.644548 |\n| 4 | 3 | 10 |  TRUE | 0.80 | 0.8670348 | 3.624489 |\n| 5 | 3 |  3 | FALSE | 0.63 | 0.8670504 | 3.622755 |\n\n","text/latex":"A data.frame: 5 × 6\n\\begin{tabular}{r|llllll}\n  & mtry & min.node.size & replace & sample.fraction & rmse & perc\\_gain\\\\\n  & <dbl> & <dbl> & <lgl> & <dbl> & <dbl> & <dbl>\\\\\n\\hline\n\t1 & 3 &  1 & FALSE & 0.63 & 0.8658314 & 3.758258\\\\\n\t2 & 3 &  5 &  TRUE & 0.80 & 0.8659706 & 3.742780\\\\\n\t3 & 3 &  5 & FALSE & 0.50 & 0.8668544 & 3.644548\\\\\n\t4 & 3 & 10 &  TRUE & 0.80 & 0.8670348 & 3.624489\\\\\n\t5 & 3 &  3 & FALSE & 0.63 & 0.8670504 & 3.622755\\\\\n\\end{tabular}\n","text/plain":"  mtry min.node.size replace sample.fraction rmse      perc_gain\n1 3     1            FALSE   0.63            0.8658314 3.758258 \n2 3     5             TRUE   0.80            0.8659706 3.742780 \n3 3     5            FALSE   0.50            0.8668544 3.644548 \n4 3    10             TRUE   0.80            0.8670348 3.624489 \n5 3     3            FALSE   0.63            0.8670504 3.622755 "},"metadata":{}}]},{"cell_type":"markdown","source":"Rerun the model with impurity-based and permutation-based importance measures.","metadata":{}},{"cell_type":"code","source":"# re-run model with impurity-based variable importance\nrf_impurity <- ranger(\n  formula = MntWines ~ ., \n  data = baked.wine.train, \n  num.trees = 2000,\n  mtry = 3,\n  min.node.size = 10,\n  sample.fraction = .63,\n  replace = FALSE,\n  importance = \"impurity\",\n  respect.unordered.factors = \"order\",\n  verbose = FALSE,\n  seed  = 123\n)","metadata":{"execution":{"iopub.status.busy":"2022-12-01T10:09:25.829499Z","iopub.execute_input":"2022-12-01T10:09:25.831008Z","iopub.status.idle":"2022-12-01T10:09:27.10599Z"},"trusted":true},"execution_count":37,"outputs":[]},{"cell_type":"code","source":"# re-run model with permutation-based variable importance\nrf_permutation <- ranger(\n  formula = MntWines ~ ., \n  data = baked.wine.train, \n  num.trees = 2000,\n  mtry = 3,\n  min.node.size = 10,\n  sample.fraction = .63,\n  replace = FALSE,\n  importance = \"permutation\",\n  respect.unordered.factors = \"order\",\n  verbose = FALSE,\n  seed  = 123\n)","metadata":{"execution":{"iopub.status.busy":"2022-12-01T10:09:33.576913Z","iopub.execute_input":"2022-12-01T10:09:33.582213Z","iopub.status.idle":"2022-12-01T10:09:36.283048Z"},"trusted":true},"execution_count":38,"outputs":[]},{"cell_type":"markdown","source":"Feature interpretation","metadata":{}},{"cell_type":"code","source":"rf.p1 <- vip(rf_impurity, bar = TRUE)\nrf.p2 <- vip(rf_permutation, bar = TRUE)\n\nvip.rf.impurity <- most_important(rf.p1)[1:4,]\nvip.rf.permutation <- most_important(rf.p2)[1:4,]\n\ngridExtra::grid.arrange(rf.p1, rf.p2, nrow = 1)","metadata":{"execution":{"iopub.status.busy":"2022-12-01T10:09:47.202591Z","iopub.execute_input":"2022-12-01T10:09:47.205787Z","iopub.status.idle":"2022-12-01T10:09:47.810763Z"},"trusted":true},"execution_count":39,