s:  4 \n    H2O cluster healthy:        TRUE \n    H2O Connection ip:          localhost \n    H2O Connection port:        54321 \n    H2O Connection proxy:       NA \n    H2O Internal Security:      FALSE \n    R Version:                  R version 4.0.5 (2021-03-31) \n\n","output_type":"stream"}]},{"cell_type":"markdown","source":"Tune stochastic GBM hyperparameters.","metadata":{}},{"cell_type":"code","source":"# refined hyperparameter grid\nsto.gbm.hyper_grid <- list(\n  sample_rate = c(0.5, 0.75, 1),              # row subsampling\n  col_sample_rate = c(0.5, 0.75, 1),          # col subsampling for each split\n  col_sample_rate_per_tree = c(0.5, 0.75, 1)  # col subsampling for each tree\n)\n\n# random grid search strategy\nsearch_criteria <- list(\n  strategy = \"RandomDiscrete\",\n  stopping_metric = \"mse\",\n  stopping_tolerance = 0.001,\n  stopping_rounds = 10,\n  max_runtime_secs = 60*10\n)\n\n# perform grid search\ngrid <- h2o.grid(\n  algorithm = \"gbm\",\n  grid_id = \"gbm_grid\",\n  x = predictors,\n  y = response,\n  training_frame = wine.train_h2o,\n  hyper_params = sto.gbm.hyper_grid,\n  ntrees = 6000,\n  learn_rate = 0.01,\n  max_depth = 7,\n  min_rows = 5,\n  nfolds = 10,\n  stopping_rounds = 10,\n  stopping_tolerance = 0,\n  search_criteria = search_criteria,\n  seed = 123\n)\n\n# collect the results and sort by the model performance metric of choice\ngrid_perf <- h2o.getGrid(\n  grid_id = \"gbm_grid\",\n  sort_by = \"mse\",\n  decreasing = FALSE\n)\n\ngrid_perf","metadata":{"execution":{"iopub.status.busy":"2022-12-01T10:12:31.996901Z","iopub.execute_input":"2022-12-01T10:12:31.998494Z","iopub.status.idle":"2022-12-01T10:22:33.067981Z"},"trusted":true},"execution_count":46,"outputs":[{"output_type":"display_data","data":{"text/plain":"H2O Grid Details\n================\n\nGrid ID: gbm_grid \nUsed hyper parameters: \n  -  col_sample_rate \n  -  col_sample_rate_per_tree \n  -  sample_rate \nNumber of models: 7 \nNumber of failed models: 0 \n\nHyper-Parameter Search Summary: ordered by increasing mse\n  col_sample_rate col_sample_rate_per_tree sample_rate        model_ids     mse\n1         0.50000                  1.00000     1.00000 gbm_grid_model_3 0.77231\n2         1.00000                  1.00000     0.75000 gbm_grid_model_4 0.80809\n3         1.00000                  0.75000     1.00000 gbm_grid_model_5 0.84253\n4         0.50000                  0.50000     1.00000 gbm_grid_model_2 0.85921\n5         1.00000                  0.50000     1.00000 gbm_grid_model_1 0.89028\n6         0.75000                  0.75000     1.00000 gbm_grid_model_6 1.96592\n7         0.50000                  0.75000     0.50000 gbm_grid_model_7 3.14483"},"metadata":{}}]},{"cell_type":"code","source":"best_model_id <- grid_perf@model_ids[[1]]\nbest_model <- h2o.getModel(best_model_id)\n\n# Now let’s get performance metrics on the best model\nh2o.performance(model = best_model, xval = TRUE)","metadata":{"execution":{"iopub.status.busy":"2022-12-01T10:24:13.135138Z","iopub.execute_input":"2022-12-01T10:24:13.137217Z","iopub.status.idle":"2022-12-01T10:24:13.426434Z"},"trusted":true},"execution_count":47,"outputs":[{"output_type":"display_data","data":{"text/plain":"H2ORegressionMetrics: gbm\n** Reported on cross-validation data. **\n** 10-fold cross-validation on training data (Metrics computed for combined holdout predictions) **\n\nMSE:  0.7723062\nRMSE:  0.8788095\nMAE:  0.6566484\nRMSLE:  0.2068291\nMean Residual Deviance :  0.7723062\n"},"metadata":{}}]},{"cell_type":"markdown","source":"Saving and retrieving RMSE for stochastic GBM","metadata":{}},{"cell_type":"code","source":"(rmse.stochatic.gbm <- sqrt(grid_perf@summary_table[[5]][1]))","metadata":{"execution":{"iopub.status.busy":"2022-12-01T10:24:16.902093Z","iopub.execute_input":"2022-12-01T10:24:16.903767Z","iopub.status.idle":"2022-12-01T10:24:16.920797Z"},"trusted":true},"execution_count":48,"outputs":[{"output_type":"display_data","data":{"text/html":"0.8788095181