<tr><td>RF     </td><td>0.8191656</td></tr>\n\t<tr><td>CART   </td><td>0.8338342</td></tr>\n</tbody>\n</table>\n","text/markdown":"\nA data.frame: 3 × 2\n\n| test.methods &lt;chr&gt; | test.rmses &lt;dbl&gt; |\n|---|---|\n| Xgboost | 0.8171452 |\n| RF      | 0.8191656 |\n| CART    | 0.8338342 |\n\n","text/latex":"A data.frame: 3 × 2\n\\begin{tabular}{ll}\n test.methods & test.rmses\\\\\n <chr> & <dbl>\\\\\n\\hline\n\t Xgboost & 0.8171452\\\\\n\t RF      & 0.8191656\\\\\n\t CART    & 0.8338342\\\\\n\\end{tabular}\n","text/plain":"  test.methods test.rmses\n1 Xgboost      0.8171452 \n2 RF           0.8191656 \n3 CART         0.8338342 "},"metadata":{}}]},{"cell_type":"markdown","source":"Amongst the three methods, Random Forest has the lowest RMSE on the test set. On the merit of this, Random Forest is chosen to fit the final models.","metadata":{}},{"cell_type":"markdown","source":"# 5 Final model and predictions","metadata":{}},{"cell_type":"markdown","source":"## 5.1 Amount spent on wine (see above)","metadata":{}},{"cell_type":"code","source":"## 5.2 Amount spent on food (fish, meat, fruits)","metadata":{"execution":{"iopub.status.busy":"2022-12-01T11:14:37.874694Z","iopub.execute_input":"2022-12-01T11:14:37.876394Z","iopub.status.idle":"2022-12-01T11:14:37.888885Z"},"trusted":true},"execution_count":72,"outputs":[]},{"cell_type":"markdown","source":"Tuning hyperparameters","metadata":{}},{"cell_type":"code","source":"# create hyperparameter grid\nfood.rf.hyper_grid <- expand.grid(\n  mtry = floor(n_features * c(.05, .15, .25, .333, .4)),\n  min.node.size = c(1, 3, 5, 10), \n  replace = c(TRUE, FALSE),                               \n  sample.fraction = c(.5, .63, .8),                       \n  rmse = NA                                               \n)\n\n# execute full cartesian grid search\nfor(i in seq_len(nrow(food.rf.hyper_grid))) {\n  # fit model for ith hyperparameter combination\n  fit <- ranger(\n    formula         = MntFood ~ ., \n    data            = baked.food.train, \n    num.trees       = n_features * 10,\n    mtry            = food.rf.hyper_grid$mtry[i],\n    min.node.size   = food.rf.hyper_grid$min.node.size[i],\n    replace         = food.rf.hyper_grid$replace[i],\n    sample.fraction = food.rf.hyper_grid$sample.fraction[i],\n    verbose         = FALSE,\n    seed            = 123,\n    respect.unordered.factors = 'order',\n  )\n  # export OOB error \n  food.rf.hyper_grid$rmse[i] <- sqrt(fit$prediction.error)\n}\n\n# assess top 5 models\nfood.rf.hyper_grid %>%\n  arrange(rmse) %>%\n  mutate(perc_gain = (rmse.rf.default - rmse) / rmse.rf.default * 100) %>%\n  head(5)","metadata":{"execution":{"iopub.status.busy":"2022-12-01T11:14:37.892353Z","iopub.execute_input":"2022-12-01T11:14:37.894069Z","iopub.status.idle":"2022-12-01T11:14:42.112494Z"},"trusted":true},"execution_count":73,"outputs":[{"output_type":"display_data","data":{"text/html":"<table class=\"dataframe\">\n<caption>A data.frame: 5 × 6</caption>\n<thead>\n\t<tr><th></th><th scope=col>mtry</th><th scope=col>min.node.size</th><th scope=col>replace</th><th scope=col>sample.fraction</th><th scope=col>rmse</th><th scope=col>perc_gain</th></tr>\n\t<tr><th></th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;lgl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th></tr>\n</thead>\n<tbody>\n\t<tr><th scope=row>1</th><td>3</td><td> 3</td><td>TRUE</td><td>0.80</td><td>0.8255187</td><td>8.239223</td></tr>\n\t<tr><th scope=row>2</th><td>3</td><td> 1</td><td>TRUE</td><td>0.63</td><td>0.8268307</td><td>8.093387</td></tr>\n\t<tr><th scope=row>3</th><td>3</td><td> 5</td><td>TRUE</td><td>0.63</td><td>0.8270090</td><td>8.073570</td></tr>\n\t<tr><th scope=row>4</th><td>3</td><td> 1</td><td>TRUE</td><td>0.80</td><td>0.8278948</td><td>7.975107</td></tr>\n\t<tr><th scope=row>5</th><td>3</td><td>10</td><td>TRUE</td><td>0.63</td><td>0.8298869</td><td>7.753679</td></tr>\n</tbody>\n</table>\n","text/markdown":"\nA data.frame: 5 × 6\n\n| <!--/--> | mtry &lt;dbl&gt; | min.node.size &lt;dbl&gt; | replace &lt;lgl&gt; | sample.fraction &lt;dbl&gt; | rmse &lt;dbl&gt; | perc_gain &lt;dbl&gt; |\n|---|---|---|---|---|---|---|\n| 1 | 3 |  3 | TRUE | 0.80 | 0.8255187 | 8.239223 |\n| 2 | 3 |  1 | TRUE | 0.63 | 0.8268307 | 8.093387 |\n| 3 | 3 |  5 | TRUE | 0.63 | 0.8270090 | 8.073570 |\n| 4 | 3 |  1 | TRUE | 0.80 | 0.8278948 | 7.975107 |\n| 5 | 3 | 10 | TRUE | 0.63 | 0.8298869 | 7.753679 |\n\n","text/latex":"A data.frame: 5 × 6\n\\begin{tabular}{r|llllll}\n  & mtry & min.node.size & replace & sample.fraction & rmse & perc\\_gain\\\\\n  & <dbl> & <dbl> & <lgl> & <dbl> & <dbl> & <dbl>\\\\\n\\hline\n\t1 & 3 &  3 & TRUE & 0.80 & 0.8255187 & 8.239223\\\\\n\t2 & 3 &  1 & TRUE & 0.63 & 0.8268307 & 8.093387\\\\\n\t3 & 3 &  5 & TRUE & 0.63 & 0.8270090 & 8.073570\\\\\n\t4 & 3 &  1 & TRUE & 0.80 & 0.8278948 & 7.975107\\\\\n\t5 & 3 & 10 & TRUE & 0.63 & 0.8298869 & 7.753679\\\\\n\\end{tabular}\n","text/plain":"  mtry min.node.size replace sample.fraction rmse      perc_gain\n1 3     3            TRUE    0.80            0.8255187 8.239223 \n2 3     1            TRUE    0.63            0.8268307 8.093387 \n3 3     5            TRUE    0.63            0.8270090 8.073570 \n4 3     1            TRUE    0.80            0.8278948 7.975107 \n5 3    10            TRUE    0.63            0.8298869 7.753679 "},"metadata":{}}]},{"cell_type":"markdown","source":"Rerun models with best parameters and feature interpretation","metadata":{}},{"cell_type":"code","source":"# re-run model with impurity-based variable importance\nfood.rf_impurity <- ranger(\n  formula = MntFood ~ ., \n  data = baked.food.train, \n  num.trees = 2000,\n  mtry = 3,\n  min.node.size = 3,\n  sample.fraction = .50,\n  replace = FALSE,\n  importance = \"impurity\",\n  respect.unordered.factors = \"order\",\n  verbose = FALSE,\n  seed  = 123\n)\n\n# re-run model with permutation-based variable importance\nfood.rf_permutation <- ranger(\n  formula = MntFood ~ ., \n  data = baked.food.train, \n  num.trees = 2000,\n  mtry = 3,\n  min.node.size = 3,\n  sample.fraction = .50,\n  replace = FALSE,\n  importance = \"permutation\",\n  respect.unordered.factors = \"order\",\n  verbose = FALSE,\n  seed  = 123\n)\n\nfood.rf.p1 <- vip::vip(food.rf_impurity)\nfood.rf.p2 <- vip::vip(food.rf_permutation)\n\ngridExtra::grid.arrange(food.rf.p1, food.rf.p2, nrow = 1)","metadata":{"execution":{"iopub.status.busy":"2022-12-01T11:14:42.114827Z","iopub.execute_input":"2022-12-01T11:14:42.116243Z","iopub.status.idle":"2022-12-01T11:14:46.123904Z"},"trusted":true},"execution_count":74,"outputs":[{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdeWAU5f3H8WeOvXeTzcFRDqEiIIKIclT0V6ugKGoDKihGLgVBUAqi5RIEQeRH\nEcEgp+EokcMiLf48irWtFqpILXhzaD2KoHLkIMfu5tid3x8bY8Rkk7Czm/Dk/fprdjL7PM/M\nzvPNJ7OzG8UwDAEAAIBzn1rfAwAAAIA5CHYAAACSINgBAABIgmAHAAAgCYIdAACAJAh2AAAA\nkiDYAQAASIJgBwAAIAm9vgeAmuXm5kbewOPxqKoaCASKi4tjOhKHw2EYRiAQiGkvdrvdZrMF\ng8HCwsKYdqTrutPpzM/Pj2kvmqa53W4hRGFhYTAYjGlfHo/H7/eXlZXFtBe3261pWnFxcRzO\nBEVR/H5/7Z+SlJQUu/Eg1mqsdSaee6ZMFlVVPR6PMGN2a5rmcrmiL0c2m81ut4dCoYKCgiib\nstvtqqr6fL4o23G5XLqul5SU1GkuV8ntdhcXF5eWlkbTiKIoCQkJQoiioiJTToD8/Pwo/9eD\nxWJxOp1CiNOnT9fyKRFqHcHuHFBjvVBVVVXV2mwZn/FET1VVwzBi3ZGqqoqixLoXRVHCr04o\nFIrDHsXhuFXsURzOhDi8QGg4alnrTDnJTWxHmDG7w9Mq+vEYhmHW9AyHlejbMbFiKIoS/atW\nMR6zToBgMBhlsNN13cSiyluxAAAAkiDYAQAASIJgBwAAIAmCHQAAgCQIdgAAAJIg2AEAAEiC\nYAcAACAJgh0AAIAkCHYAAACSINgBAABIgmAHAAAgCYIdAACAJPT6HgDMkZ6eXt9DAGIrIyOj\nvoeA+ketg/SirHVcsQMAAJAEwQ4AAEASBDsAAABJEOwAAAAkQbADAACQBMEOAABAEgQ7AAAA\nSRDsAAAAJEGwAwAAkATBDgAAQBIEOwAAAEkQ7AAAACRBsAMAAJAEwQ4AAEASBDsAAABJEOwA\nAAAkQbADAACQBMEOAABAEgQ7AAAASRDsAAAAJEGwAwAAkATBDgAAQBIEOwAAAEkQ7AAAACRB\nsAMAAJAEwQ4AAEASBDsAAABJEOwAAAAkQbADAACQBMEOAABAEgQ7AAAASRDsAAAAJEGwAwAA\nkATBDgAAQBIEOwAAAEkQ7AAAACTReIPdF1sevGXQmPoeBQDEFrUOaFQab7ADAACQDMHuTMGQ\nYUYzoaApzQBAbFDrACnp9T2AhmLErQNvfvr