, exp(6.618)))\nprint(paste(\"percentile:\", sum(df.food$MntFood<exp(6.618))/length(df.food$MntFood)))\nprint(paste(\"age <=:\", 1.09*sd(customers$Age)+mean(customers$Age)))\nprint(paste(\"days customers >:\", -0.402*sd(customers$DaysCustomer)+mean(customers$DaysCustomer)))\nprint(paste(\"have kids <=:\", -1.611*sd(customers$HaveKids)+mean(customers$HaveKids)))\nprint(paste(\"age >:\", -1.013*sd(customers$Age)+mean(customers$Age)))\nprint(paste(\"income >:\", 0.261*income.sd.food+income.mean.food))","metadata":{"execution":{"iopub.status.busy":"2022-12-01T11:14:54.289986Z","iopub.execute_input":"2022-12-01T11:14:54.291435Z","iopub.status.idle":"2022-12-01T11:14:54.32623Z"},"trusted":true},"execution_count":76,"outputs":[{"name":"stdout","text":"[1] \"highest prediction: 748.446705808426\"\n[1] \"percentile: 0.921735241502683\"\n[1] \"age <=: 57.8585437617482\"\n[1] \"days customers >: 272.496268436103\"\n[1] \"have kids <=: -0.0121857934168705\"\n[1] \"age >: 33.2465444513731\"\n[1] \"income >: 57526.8714570972\"\n","output_type":"stream"}]},{"cell_type":"markdown","source":"## 5.3 Amount spent on sweets\n\nTuning hyperparameters","metadata":{}},{"cell_type":"code","source":"# create hyperparameter grid\nsweet.rf.hyper_grid <- expand.grid(\n  mtry = floor(n_features * c(.05, .15, .25, .333, .4)),\n  min.node.size = c(1, 3, 5, 10), \n  replace = c(TRUE, FALSE),                               \n  sample.fraction = c(.5, .63, .8),                       \n  rmse = NA                                               \n)\n\n# execute full cartesian grid search\nfor(i in seq_len(nrow(sweet.rf.hyper_grid))) {\n  # fit model for ith hyperparameter combination\n  fit <- ranger(\n    formula         = MntSweetProducts ~ ., \n    data            = baked.sweet.train, \n    num.trees       = n_features * 10,\n    mtry            = sweet.rf.hyper_grid$mtry[i],\n    min.node.size   = sweet.rf.hyper_grid$min.node.size[i],\n    replace         = sweet.rf.hyper_grid$replace[i],\n    sample.fraction = sweet.rf.hyper_grid$sample.fraction[i],\n    verbose         = FALSE,\n    seed            = 123,\n    respect.unordered.factors = 'order',\n  )\n  # export OOB error \n  sweet.rf.hyper_grid$rmse[i] <- sqrt(fit$prediction.error)\n}\n\n# assess top 5 models\nsweet.rf.hyper_grid %>%\n  arrange(rmse) %>% \n  head(5)","metadata":{"execution":{"iopub.status.busy":"2022-12-01T11:14:54.328601Z","iopub.execute_input":"2022-12-01T11:14:54.330019Z","iopub.status.idle":"2022-12-01T11:14:58.470549Z"},"trusted":true},"execution_count":77,"outputs":[{"output_type":"display_data","data":{"text/html":"<table class=\"dataframe\">\n<caption>A data.frame: 5 × 5</caption>\n<thead>\n\t<tr><th></th><th scope=col>mtry</th><th scope=col>min.node.size</th><th scope=col>replace</th><th scope=col>sample.fraction</th><th scope=col>rmse</th></tr>\n\t<tr><th></th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;lgl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th></tr>\n</thead>\n<tbody>\n\t<tr><th scope=row>1</th><td>3</td><td>1</td><td>TRUE</td><td>0.80</td><td>1.179371</td></tr>\n\t<tr><th scope=row>2</th><td>3</td><td>3</td><td>TRUE</td><td>0.63</td><td>1.184389</td></tr>\n\t<tr><th scope=row>3</th><td>0</td><td>1</td><td>TRUE</td><td>0.80</td><td>1.185402</td></tr>\n\t<tr><th scope=row>4</th><td>2</td><td>1</td><td>TRUE</td><td>0.80</td><td>1.185402</td></tr>\n\t<tr><th scope=row>5</th><td>2</td><td>1</td><td>TRUE</td><td>0.80</td><td>1.185402</td></tr>\n</tbody>\n</table>\n","text/markdown":"\nA data.frame: 5 × 5\n\n| <!--/--> | mtry &lt;dbl&gt; | min.node.size &lt;dbl&gt; | replace &lt;lgl&gt; | sample.fraction &lt;dbl&gt; | rmse &lt;dbl&gt; |\n|---|---|---|---|---|---|\n| 1 | 3 | 1 | TRUE | 0.80 | 1.179371 |\n| 2 | 3 | 3 | TRUE | 0.63 | 1.184389 |\n| 3 | 0 | 1 | TRUE | 0.80 | 1.185402 |\n| 4 | 2 | 1 | TRUE | 0.80 | 1.185402 |\n| 5 | 2 | 1 | TRUE | 0.80 | 1.185402 |\n\n","text/latex":"A data.frame: 5 × 5\n\\begin{tabular}{r|llll