bm,\n  vip.cart,\n  vip.lm,\n  vip.rf.impurity,\n  vip.stochastic.gbm,\n  vip.xgb\n)\n\ndf.vip %>% \n  mutate_all(funs(str_replace(., \"DaysCustomer\", \"Days_Customer\")))","metadata":{"execution":{"iopub.status.busy":"2022-12-01T11:15:58.751607Z","iopub.execute_input":"2022-12-01T11:15:58.753299Z","iopub.status.idle":"2022-12-01T11:15:58.900608Z"},"trusted":true},"execution_count":82,"outputs":[{"name":"stderr","text":"Warning message:\n“\u001b[1m\u001b[22m`funs()` was deprecated in dplyr 0.8.0.\n\u001b[36mℹ\u001b[39m Please use a list of either functions or lambdas:\n\n# Simple named list: list(mean = mean, median = median)\n\n# Auto named with `tibble::lst()`: tibble::lst(mean, median)\n\n# Using lambdas list(~ mean(., trim = .2), ~ median(., na.rm = TRUE))”\n","output_type":"stream"},{"output_type":"display_data","data":{"text/html":"<table class=\"dataframe\">\n<caption>A data.frame: 4 × 7</caption>\n<thead>\n\t<tr><th scope=col>importance</th><th scope=col>vip.basic.gbm</th><th scope=col>vip.cart</th><th scope=col>vip.lm</th><th scope=col>vip.rf.impurity</th><th scope=col>vip.stochastic.gbm</th><th scope=col>vip.xgb</th></tr>\n\t<tr><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;chr&gt;</th></tr>\n</thead>\n<tbody>\n\t<tr><td>1st</td><td>Income       </td><td>Income       </td><td>Income       </td><td>Income       </td><td>Income       </td><td>Income       </td></tr>\n\t<tr><td>2nd</td><td>Days_Customer</td><td>Age          </td><td>Days_Customer</td><td>Days_Customer</td><td>Days_Customer</td><td>Days_Customer</td></tr>\n\t<tr><td>3rd</td><td>Recency      </td><td>Days_Customer</td><td>Graduated    </td><td>Age          </td><td>Age          </td><td>Recency      </td></tr>\n\t<tr><td>4th</td><td>Age          </td><td>Graduated    </td><td>Age          </td><td>HaveKids     </td><td>Recency      </td><td>Age          </td></tr>\n</tbody>\n</table>\n","text/markdown":"\nA data.frame: 4 × 7\n\n| importance &lt;chr&gt; | vip.basic.gbm &lt;chr&gt; | vip.cart &lt;chr&gt; | vip.lm &lt;chr&gt; | vip.rf.impurity &lt;chr&gt; | vip.stochastic.gbm &lt;chr&gt; | vip.xgb &lt;chr&gt; |\n|---|---|---|---|---|---|---|\n| 1st | Income        | Income        | Income        | Income        | Income        | Income        |\n| 2nd | Days_Customer | Age           | Days_Customer | Days_Customer | Days_Customer | Days_Customer |\n| 3rd | Recency       | Days_Customer | Graduated     | Age           | Age           | Recency       |\n| 4th | Age           | Graduated     | Age           | HaveKids      | Recency       | Age           |\n\n","text/latex":"A data.frame: 4 × 7\n\\begin{tabular}{lllllll}\n importance & vip.basic.gbm & vip.cart & vip.lm & vip.rf.impurity & vip.stochastic.gbm & vip.xgb\\\\\n <chr> & <chr> & <chr> & <chr> & <chr> & <chr> & <chr>\\\\\n\\hline\n\t 1st & Income        & Income        & Income        & Income        & Income        & Income       \\\\\n\t 2nd & Days\\_Customer & Age           & Days\\_Customer & Days\\_Customer & Days\\_Customer & Days\\_Customer\\\\\n\t 3rd & Recency       & Days\\_Customer & Graduated     & Age           & Age           & Recency      \\\\\n\t 4th & Age           & Graduated     & Age           & HaveKids      & Recency       & Age          \\\\\n\\end{tabular}\n","text/plain":"  importance vip.basic.gbm vip.cart      vip.lm        vip.rf.impurity\n1 1st        Income        Income        Income        Income         \n2 2nd        Days_Customer Age           Days_Customer Days_Customer  \n3 3rd        Recency       Days_Customer Graduated     Age            \n4 4th        Age           Graduated     Age           HaveKids       \n  vip.stochastic.gbm vip.xgb      \n1 Income             Income       \n2 Days_Customer      Days_Customer\n3 Age                Recency      \n4 Recency            Age          "},"metadata":{}}]},{"cell_type":"markdown","source":"It can be seen from the first and second rows of the above table that:\n\n* `Income` is always the most important variable in predicting spending\n* `DaysCustomer` (or `Days_Customer` used in presentation) is the next most important variable\n* other variables such as `Age`, `Recency` and `Graduated` also have some impacts","metadata":{}},{"cell_type":"markdown","source":"## 6.2 Recommendations actions\nBased on the above findings, it is recommended to target customers that are \n\n1. in the high income group (e.g. with an income higher than $57,000), and \n2. old customers (e.g. who have been registered with this supermarket for more than 270 days)\n\nThe supermarket may consider various marketing strategies including: \n1. Forming VIP clubs for high income groups; \n2. creating loyalty/rewards programmes for old customers; and \n3. send out offers for each product targeting specifically at the “ideal customer” identified for each product category.","metadata":{}}]}